import { style } from "typestyle";


const BiuryBoxStyle = style({
    display: 'flex',
    height: '100vh',
    width: '100%',
    $nest: {
        '& .biuryBox_image': {
            // background: `url(${biuryBoxImage})`,
            // backgroundSize: 'cover',
            backgroundPosition: 'center',
            backgroundRepeat: 'no-repeat',
            width: '50%',
            height: '100%',
            $nest: {
                '& img': {
                    width: '100%'
                }
            }
        }
    }
})

export default BiuryBoxStyle
